/** all window start animation **/
function startAnimation(which, window) {
  clearTimeout(windowClosingTimer);
  emitter.emit('window-open-start',{which,window});
  windowOpeningTimer = setTimeout(function(){
    emitter.emit('window-open-end',{which,window});
    clearTimeout(windowOpeningTimer)
  },2000)
  switch(which) {
    case 1: {
      if(window == "big") {
        //start big window animation
        _$("#Path_511_first_window").setAttribute("d", "M0,0H434.544V145.361H0Z");
        _$("#Line_11_first_window").setAttribute("transform", "translate(208.29 122.211)");
        document.getElementById('win1para1').style.transition = "all 2s";
        document.getElementById('win1para1').style.backgroundColor = "#24cad2";
      } else if(window == "small") {
        //start small window animation
        _$("#Path___484").setAttribute("d", "M0,0H175.7V57.532H0Z");
        _$("#Line___3").setAttribute("transform","translate(67.296 20.928)");
      }
      break;
    }
    case 2: {
      if(window == "big") {
        //start big window animation
        _$("#Path_511_second_window").setAttribute("d", "M0,0H434.544V145.361H0Z");
        _$("#Line_11_second_window").setAttribute("transform", "translate(208.29 122.211)");
        document.getElementById('win2para2').style.transition = "all 2s";
        document.getElementById('win2para2').style.backgroundColor = "#24cad2";
      } else if(window == "small") {
        _$("#Rectangle_i3").setAttribute("height", "62.119");
        _$("#Line_i3").setAttribute("transform","translate(67.614 24.131)");    
      }
      break;
    }
    case 3: {
      if(window == "big") {
        //start big window animation
        _$("#Path_511_third_window").setAttribute("d", "M0,0H434.544V145.361H0Z");
        _$("#Line_11_third_window").setAttribute("transform", "translate(208.29 122.211)");
        document.getElementById('win3para3').style.transition = "all 2s";
        document.getElementById('win3para3').style.backgroundColor = "#24cad2";
      } else if(window == "small") {
        _$("#Rectangle__3").setAttribute("height", "58.208");
        _$("#Line__3").setAttribute("transform","translate(68.867 24.178)");
      }
      break;
    }
    default: {
      console.log("No window found for start animation!");
      break;
    }
  }
}
