/** open sepecific screen after animation complete or switch screen **/
function openWindow(which) {
  document.body.style.cursor = "pointer"
  if(whichWindow == "big") {
    switch (which) {
      case 1: {
        // open first window
        firstScreen();
        whichWindow = "small"
        break;
      }
      case 2: {
        secondScreen();
        whichWindow = "small"
        break;
      }
      case 3: {
        thirdScreen();
        whichWindow = "small"
        break;
      }
      default: {
        console.log("Wrong window!")
        break;
      }
    }
  } else if(whichWindow = "small") {
    switch (which) {
      case 1: {
        firstScreen();
        closePopup();
        break;
      }
      case 2: {
        secondScreen();
        hidePlanePopupScreenOne();
        break;
      }
      case 3: {
        thirdScreen();
        closePopup();
        hidePlanePopupScreenOne();
        break;
      }
      default: {
        console.log("Wrong window!")
        break;
      }
    }
  }
}
