/**************/
/** calculate two city location distance and shorten flight path curvature **/
function calculateDistance(to, from) {
  var sqrY = Math.pow(to.y - from.y, 2);
  var sqrX = Math.pow(to.x - from.x, 2);
  var total = sqrY + sqrX;
  return Math.sqrt(total);
}
